import React from 'react';
import Home from './components/home.js';
import About from './components/aboutme.js';
import './sass/header.scss';
import 'bootstrap/dist/css/bootstrap.min.css';
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';

import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBMask, MDBBtn, MDBView, MDBFooter, MDBRow, MDBCol, MDBContainer } from 'mdbreact';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

class Header extends React.Component {
   constructor(props) {
     super(props);
     this.state = {
       collapse: false,
       isWideEnough: false,
     };
     this.onClick = this.onClick.bind(this);
   }

   onClick() {
     this.setState({
       collapse: !this.state.collapse,
     });
   }

   render() {
     return (
       <div className="main-wrapper">
         <header className="mainHeader">
             <MDBNavbar className="justify-content-center" color="black" fixed="top" dark expand="md" scrolling transparent>
               <MDBNavbarBrand href="/">
                 <strong>JD</strong>
               </MDBNavbarBrand>
               {!this.state.isWideEnough && <MDBNavbarToggler onClick={this.onClick} />}
               <MDBCollapse isOpen={this.state.collapse} navbar>
                  <MDBNavbarNav>
                      <MDBNavItem active>
                        <MDBNavLink to="/">Home</MDBNavLink>
                      </MDBNavItem>
                      <MDBNavItem>
                        <MDBNavLink to="/aboutme">About Me</MDBNavLink>
                      </MDBNavItem>
                      <MDBNavItem>
                        <MDBNavLink to="#">Portfolio</MDBNavLink>
                      </MDBNavItem>
                      <MDBNavItem>
                        <MDBNavLink to="#">Contact Us</MDBNavLink>
                      </MDBNavItem>                   
                  </MDBNavbarNav>
               </MDBCollapse>
             </MDBNavbar>

           <MDBView src="https://mdbootstrap.com/img/Photos/Others/img%20(50).jpg">
             <MDBMask overlay="black-strong" className="flex-center flex-column text-white text-center">
               <h1>I Am Jane Reforma</h1>
               <h5>Senior Web Developer</h5>
               <MDBBtn rounded outline color="warning">Explore More</MDBBtn>
             </MDBMask>
           </MDBView>
         </header>
       </div>
     );
   }
 }

class App extends React.Component {
   render() {
      return (
         <div className="main">
         <Router>
               <Header />
               <Switch>
                     <Route exact path="/">
                        <Home />
                     </Route>
                     <Route exact path="/aboutme">
                        <About />
                     </Route>
               </Switch>
         </Router>
        <MDBFooter color="black" className="font-small">
            <div className="footer-copyright text-center py-3">
              <MDBContainer fluid>
                &copy; {new Date().getFullYear()} Copyright: <a href="https://www.MDBootstrap.com"> Jane.com </a>
              </MDBContainer>
            </div>
        </MDBFooter>         
         </div>
      );
   }
}
export default App;
